  const { btnCo, btnAct, btnText, btnLogo, btnStyle, btnType } = props;

  return (
    <>
      <Button
        type={btnType}
        className={btnStyle}
        onClick={btnAct}
        variant={btnCo}
      >
        <p className="m-0">
          <i className={btnLogo}> </i> {btnText}
        </p>
      </Button>{" "}
    </>
  );
}
